import React, { Component } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import { Link } from 'react-router-dom';
import { useState, useEffect } from 'react';
import './Navbar.css';



export default function Navbar() {

  const [click, setClick] = useState(false);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);


  return (
    <div className="navbar">
       <div className='navbar-container'>
      <AppBar position="fixed" elevation={0}>
        <Toolbar>
          <Typography  variant="body2" className='navbar-container'>
          <Link to="/" className='navbar-logo' onClick={closeMobileMenu}>Skywalker</Link>
          </Typography>

   		 <div className='menu-icon' onClick={handleClick}>
          	  <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
        	  </div>

              <Menu className={click ? 'nav-menu active' : 'nav-menu'}>

               <MenuItem className="nav-item">

               <Link onClick={closeMobileMenu} to="/">Home</Link>

                </MenuItem>

                <MenuItem className="nav-item">
                <Link onClick={closeMobileMenu} to="/resume">Resume</Link>
                </MenuItem>

                <MenuItem className='nav-item'>
                <Link onClick={closeMobileMenu} to="/projects">Projects</Link>
                </MenuItem>

                <MenuItem className='nav-item'>
                <Link onClick={closeMobileMenu} to="/contact">Contact</Link>
                </MenuItem>

              </Menu>
        </Toolbar>
      </AppBar>
      </div>
    </div>
  );
  }
































